import React from 'react';
import ReactDOM from 'react-dom';
import Build from './Build';

class Inputs extends React.Component {
	constructor(props) {
    super(props);
    this.state = {
      url: '',
      source: '',
      medium: '',
      campaign: '',
      content: '',
      term: ''
    };
    this.sendToBuild = this.sendToBuild.bind(this);
  }

	sendToBuild() {
		<Build />;
	}

	render() {

		// let parameters = {
		// 	url: '',
		// 	source: '',
		// 	medium: '',
		// 	campaign: '',
		// 	content: '',
		// 	term: ''

		// }

		return (
			<div className="Inputs">
				<div className="Parameterinput">
					<label>URL:</label>
					 <input
			            name="url"
			            type="text"
			            value={this.state.url}
			            onChange={this.handleInputChange} />
				</div>
				<div className="Parameterinput">
					<label>Source:</label>
					<input type="text" name="source" value="" />
				</div>
				<div className="Parameterinput">
					<label>Medium:</label>
					<input type="text" name="medium" value="" />
				</div>
				<div className="Parameterinput">
					<label>Campaign:</label>
					<input type="text" name="campaign" value="" />
				</div>
				<div className="Parameterinput">
					<label>Content:</label>
					<input type="text" name="content" value="" />
				</div>
				<div className="Parameterinput">
					<label>Term:</label>
					<input type="text" name="term" value="" />
				</div>
				<button type="button" onClick={this.sendToBuild}>Build QueryString</button>
			</div>
		)
	};
};

export default Inputs;
